import React, { Component } from "react";
import "./Feladatok.css";
import buttonBack from '../../assets/buttonBack.png'




class Feladatok extends Component {

  render() {
    var visibility = "hide";
    if (this.props.feladatokVisibility) {
      visibility = "show";
    }

  return (
    <div>
      <div id="flyoutMenu" className={visibility}>
        <div id = 'titleFeladatok'>
          <h1>Feladatok</h1>
        </div>
        <div id = 'floatingButton'>
          <img id = 'buttonBack' src = {buttonBack} alt = 'buttBack' onMouseDown={this.props.handleFeladatok} ></img>
        </div>

      </div>
    </div>
    );
  }
}
export default Feladatok;
